export default class extends React.Component {
    render() {
        return (
            <>
                <div className="footer">

                </div>
                <style jsx>{`
            .footer {
                position: fixed;
                left: 0;
                bottom: 0;
                width: 100%;
                height: 22%;
                background: black;
                color: white;
                justify-content: center;
                align-items: center;
                display: flex;
                flex-wrap: wrap;
             }
        `}</style>
            </>
        );
    }
}
